import React from 'react';
import './Home.css';
import Header from '../components/Header';
import './dmitry-shamis-uaufwPBhbio-unsplash.jpg';


function Home() {
    return (
        <div>
          <Header />
          <div className="home-container">
            <p>this is a paragraph</p>
            <img className="img-top" src='./dmitry-shamis-uaufwPBhbio-unsplash.jpg' alt=""></img>
          </div>
          <h1>This is the Home Page</h1>  
        </div>
    )
}

export default Home
